  input: TEXT,F3XA,,"This report was amended for the following reasons. 1.Transfers
    from the Julia Carson Committee have been reflected on the correct line. 2. Schedule
    H4 has been corrected there was an importing error.  In reference to you letter
    dated March 17, 2006, the beginning cash balance has been corrected to match the
    ending balance from the Aug Monthly Report. 3. Totals have been corrected. 4.
    the printing did not clearly identify a federal candidate nor promote support
    oppose or attack any canddiate for Federal office nor express advocacy for any
    federal candidate. 5. There were no employees during this time that spent more
    25 % or more of their compensated time on FEA or any activities connected with
    FEA. 6. The additional disbursements and receipts shown on the amended report
    are due to a miscommunication during the transition of Comptrollers.  Specifically,
    how to properly import and disclose expenses that were paid on a split.  Kimberly
    did not clearly understand that she had to take further steps after she imported
    the information into her FEC file software in order to properly show the non federal
    portion of the disbursements and the receipts paid by the non federal account.
    All reports going forward will correctly disclose allocable expenses. The additional
    disbursements and receipts did not adjust the Cash on Hand balance."
